mapper.select:

select 

from VEHICLE_OPE_LOG
where TIME = #{time,jdbcType=VARCHAR}
  and TSC_ID = #{tscId,jdbcType=DECIMAL}
  and VEHICLE_ID = #{vehicleId,jdbcType=VARCHAR}

mapper.delete:

delete from VEHICLE_OPE_LOG
where TIME = #{time,jdbcType=VARCHAR}
  and TSC_ID = #{tscId,jdbcType=DECIMAL}
  and VEHICLE_ID = #{vehicleId,jdbcType=VARCHAR}
